import React, { useState } from 'react'
import PropTypes from 'prop-types'


function Filter(props) {
    const [title,setTitle]= useState("Mission Impossible : Ghost Protocol");
    const [rating, setRating] = useState(7);
    const handleClick=()=>{
        alert('filter');
    }
  return (
      <>
    <div class='app-header row'>
        <div class="col-4">
          <label for="title" class="form-label">TITLE</label>
          <input type="text" value={title} class="form-control" id="title" placeholder="title"/>
        </div>
        <div class="col-4">
          <label for="rating" class="form-label">RATING</label>
          <input type="number" value={rating} class="form-control" id="rating"/>
        </div>
        <div class="col-4">
          <button type="number" onClick={handleClick} class="btn btn-primary" id="filter">FILTER</button>
        </div>
    </div>
    </>
  )
}

Filter.propTypes = {}

export default Filter
